import { Button, IconButton, Pagination, Typography } from "@mui/material";
import Card from "@mui/material/Card";
import Piechart from "./Piechart";
import { useState } from "react";
import { ExpenseModal, IncomeModal } from "./Modals";
import LocalDiningIcon from "@mui/icons-material/LocalDining";
import SportsEsportsIcon from "@mui/icons-material/SportsEsports";
import FlightIcon from "@mui/icons-material/Flight";
import HighlightOffIcon from '@mui/icons-material/HighlightOff';
import ModeIcon from '@mui/icons-material/Mode';
import Barchart from "./Barchart";
import ArrowLeftAltIcon from '@mui/icons-material/KeyboardBackspace';
import ArrowRightAltIcon from '@mui/icons-material/ArrowRightAlt';

const Dashboard = () => {
    // Modals useStates
    const [openIncome, setOpenIncome] = useState(false);

    const handleOpenIncomeModal = () => {
        setOpenIncome(true);
    };

    const handleCloseIncomeModal = () => {
        setOpenIncome(false);
    };

    const [openExpense, setOpenExpense] = useState(false);

    const handleOpenExpenseModal = () => {
        setOpenExpense(true);
    };

    const handleCloseExpenseModal = () => {
        setOpenExpense(false);
    };
    // Modals useStates Ends here

    const [walletBalance, setWalletBalance] = useState(5000);

    const userData = {
        income: 5000,
        expenses: [
            {
                date: "2024-03-23",
                title: "Groceries",
                amount: 50,
                category: "Food",
            },
            {
                date: "2024-03-22",
                title: "Entertainment",
                amount: 130,
                category: "Entertainment",
            },
            {
                date: "2024-03-21",
                title: " Bus Travel",
                amount: 100,
                category: "Travel",
            },{
            date: "2024-03-20",
                title: "Groceries",
                amount: 30,
                category: "Food",
            }
        ],
    };

    const expenseCategoryIcons = {
        Food: <LocalDiningIcon sx={{ borderRadius: "50%", backgroundColor: "rgba(217, 217, 217, 1)", padding: "0.1rem" }} />,
        Entertainment: <SportsEsportsIcon sx={{ borderRadius: "50%", backgroundColor: "rgba(217, 217, 217, 1)", padding: "0.1rem" }} />,
        Travel: <FlightIcon sx={{ borderRadius: "50%", backgroundColor: "rgba(217, 217, 217, 1)", padding: "0.1rem" }} />
    };

    return (
        <div>
            <div
                className="top_section"
                style={{
                    backgroundColor: "#626262",
                    display: "flex",
                    justifyContent: "space-evenly",
                    alignItems: "center",
                    padding: "10px",
                    borderRadius: "15px",
                    height: "15rem",
                }}
            >
                <Card
                    className="income_card"
                    sx={{
                        width: "355.41px",
                        height: "181px",
                        backgroundColor: "#9b9b9b",
                        color: "#fff",
                        display: "flex",
                        justifyContent: "center",
                        flexDirection: "column",
                        alignItems: "center",
                    }}
                >
                    <Typography
                        sx={{
                            fontSize: "30px",
                            fontWeight: "400",
                            lineHeight: "34.47px",
                            paddingBottom: "20px",
                        }}
                    >
                        Wallet Balance:{" "}
                        <span style={{ color: "rgba(157, 255, 91, 1)", fontWeight: "700" }}>
                            &#x20B9; {walletBalance}
                        </span>
                    </Typography>
                    <Button
                        sx={{
                            width: "80%",
                            color: "#fff",
                            backgroundColor: "rgba(181, 220, 82, 1)",
                            borderRadius: "15px",
                            ":hover": { backgroundColor: "rgba(181, 220, 82, 1)" },
                        }}
                        onClick={handleOpenIncomeModal}
                    >
                        + Add Income
                    </Button>
                </Card>

                <Card
                    className="expense_card"
                    sx={{
                        width: "355.41px",
                        height: "181px",
                        backgroundColor: "#9b9b9b",
                        color: "#fff",
                        display: "flex",
                        justifyContent: "center",
                        flexDirection: "column",
                        alignItems: "center",
                    }}
                >
                    <Typography
                        sx={{
                            fontSize: "30px",
                            fontWeight: "400",
                            lineHeight: "34.47px",
                            paddingBottom: "20px",
                        }}
                    >
                        Expense:{" "}
                        <span style={{ color: "rgba(157, 255, 91, 1)", fontWeight: "700" }}>
                            &#x20B9; 500
                        </span>
                    </Typography>
                    <Button
                        sx={{
                            width: "80%",
                            color: "#fff",
                            backgroundColor: "rgba(255, 149, 149, 1)",
                            borderRadius: "15px",
                            ":hover": { backgroundColor: "rgba(255, 149, 149, 1)" },
                        }}
                        onClick={handleOpenExpenseModal}
                    >
                        + Add Expense
                    </Button>
                </Card>
                <Piechart />
            </div>

            <IncomeModal
                open={openIncome}
                onClose={handleCloseIncomeModal}
                setWalletBalance={setWalletBalance}
            />
            <ExpenseModal
                open={openExpense}
                onClose={handleCloseExpenseModal}
                walletBalance={walletBalance}
                setWalletBalance={setWalletBalance}
            />
            <div style={{ display: "flex", flexDirection: "row", width: "100%", justifyContent: "space-between", alignContent: "center", margin: 0 }}>
                <div style={{width:"100%"}}>
                    <h3>Recent transactions</h3>
                    <Card>
                        {userData.expenses.map((e) => (
                            <div style={{ display: "flex", justifyContent: "space-between", alignItems: "flex-start", width: "90%", margin: "1rem" }}>
                                <div style={{ display: "flex", justifyContent: "start", alignItems: "center" }}>
                                    {expenseCategoryIcons[e.category]}
                                    <div style={{ display: "flex", justifyContent: "center", flexDirection: "column", marginLeft: "1rem" }} >
                                        <Typography sx={{ fontSize: "16px", fontWeight: "400" }}>{e.title}</Typography>
                                        <Typography sx={{ fontSize: "16px", fontWeight: "400" }}>{e.date}</Typography>
                                    </div>
                                </div>
                                <div style={{ display: "flex", flexDirection: "row", alignItems: "center", }}>
                                    <div style={{ color: "rgba(244, 187, 74, 1)", fontSize: "16px", fontWeight: "700", justifyContent: "left", display: "flex" }}>&#x20B9;{e.amount}</div>
                                    <div style={{ display: "flex", alignItems: "center" }}>
                                        <div><IconButton sx={{ color: "#fff", backgroundColor: "rgba(255, 62, 62, 1)", borderRadius: "10px", margin: "0.5rem" }}><HighlightOffIcon /></IconButton>
                                        </div>
                                        <div>
                                            <IconButton sx={{ color: "#fff", backgroundColor: "rgba(244, 187, 74, 1)", borderRadius: "10px" }}><ModeIcon /></IconButton>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        ))}
                         <div style={{display:"flex", justifyContent:'center'}}> 
                            <IconButton sx={{backgroundColor:"rgba(241, 241, 241, 1)"}}><ArrowLeftAltIcon/></IconButton>
                            <IconButton sx={{backgroundColor:"rgba(67, 150, 123, 1)", margin:'0 1.5rem'}}>1</IconButton>
                            <IconButton sx={{backgroundColor:"rgba(241, 241, 241, 1)"}}><ArrowRightAltIcon/></IconButton>
                         </div>
                    </Card>
                   
                </div>
                <div style={{width:"50%", marginLeft:'1rem'}}>
                    <h3>Top Expenses</h3>
                    <div>
                        <Card>
                            <div>
                            <Barchart userData={userData}/>
                            </div>
                        </Card>
                        
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Dashboard;
